insert into inventory_branch_detail (branch_id, branch_name, inventory_id, inventory_name, reorder_inventory_id,
                                     stock, created_at, updated_at, created_by, updated_by, changed_at)
select branch_id,
       min(branch_name),
       inventory_id,
       min(inventory_name),
       min(reorder_inventory_id),
       sum(closing),
       min(created_at),
       max(updated_at),
       min(created_by),
       min(updated_by),
       current_timestamp
from batch
group by branch_id, inventory_id
on conflict (branch_id, inventory_id) do update set stock      = round(excluded.stock::numeric, 4)::float,
                                                    changed_at = excluded.changed_at;
